import time
from rasa_sdk import Tracker, Action
from rasa_sdk.events import SlotSet
from typing import Any, Text, Dict ,List
from rasa_sdk.executor import CollectingDispatcher
from actions.utils import send_email
from database_connectivity import DataUpdate, faq_DataUpdate
# from rasa_sdk.events import UserUtteranceReverted
# from rasa_sdk.types import DomainDict
# from rasa_sdk.events

from tensorflow import keras
from tensorflow.keras.models import load_model
import tensorflow_hub as hub
import tensorflow_text as text
from googlesearch import search

model = load_model("model1",custom_objects={'KerasLayer':hub.KerasLayer})

def check_pred(Query):
     prediction = model.predict([Query])
     if(prediction > 0.6):
          return 1
     return 0
    
def search_q(question,original):  
    for j in search(question, tld="co.in", num=1, stop=1, pause=1):
        pred_num=check_pred(original)
        if pred_num==1:
            faq_DataUpdate(original)
            return j
        else:
            return ("Sorry! I can't answer this query")

# this class will collect user details and send emails accordingly
class ActionCollectDetails(Action):
    

    def name(self) -> Text:
        return "action_collect_details"
    
    

    def run(self, dispatcher: CollectingDispatcher,
            tracker: Tracker,
            domain: Dict[Text, Any]) -> List[Dict[Text, Any]]:
        name = tracker.get_slot("name")
        number = tracker.get_slot("number")
        email = tracker.get_slot("email")
        if not name:
            dispatcher.utter_message(text="I could able to recognize you so please contact us directly at 011-29581000 , 011-29581333!!")
        else:
            # dispatcher.utter_message(text="Thanks "+name+", our team will contact you via "+email+" or at "+number);
            mssg="Dear "+name+",\n\nWe highly regret that your queries were not got cleared through our virtual assistant.\nWe highly appreciate your patience.our executive will get back to you at "+number+" within 15 minutes"
            mssg+="\n\n\nThanks & Regards\nCustomer Support Team\nAICTE"
            send_email("AICTE Customer Service",email,mssg)
            DataUpdate(name,number,email)
        return []


# this class will store faq in database
class ActionStoreFaq(Action):

    def name(self) -> Text:
        return "action_store_faq"        

    def run(self, dispatcher: CollectingDispatcher,
            tracker: Tracker,
            domain: Dict[Text, Any]) -> List[Dict[Text, Any]]:

        qry=(tracker.latest_message)['text']
        qry1=qry+"aicte pdf"
        result=search_q(qry1,qry)
        dispatcher.utter_message(result)
            
    
    
    
